  let response = await fetch('/settings')
  let settings = await response.json()

  ReactDOM.render(
    <React.StrictMode>
      <App rows={settings.rows} columns={settings.cols} wordle={settings.wordle}/>
    </React.StrictMode>,
    document.getElementById('root')
  );
} 

